function SearchByFilters(props) {
  console.log(props);

  return (
    <>
      <label className='form__search--labelSelect' htmlFor='filtersSpecie'>
        Filtrar por especie:
      </label>
      <select
        className='form__search--inputSearch'
        name='filtersSpecie'
        id='filtersSpecie'
        value={props.searchSpecie}
        onChange={props.handleSearchSpecie}
      >
        <option value='all'>Todos</option>
        <option value='human'>Humano</option>
        <option value='alien'>Alien</option>
      </select>
      <label className='form__search--labelSelect' htmlFor='filtersStatus'>
        Filtrar por estado:
      </label>
      <select
        className='form__search--inputSearch'
        name='filtersStatus'
        id='filtersStatus'
        // value={props.searchFilters}
        //onChange={props.handleSearchFilters}
      >
        <option value='all'>Todos</option>
        <option value='alive'>Vivo</option>
        <option value='dead'>Muerto</option>
        <option value='unkown'>Desconocido</option>
      </select>
    </>
  );
}
export default SearchByFilters;
